import React, { Component } from 'react';
import {connect} from 'react-redux';
import KhuNha from './khuNha';
import {hienThiCacKhuNha as hienThiCacKhuNha} from '../../../actions/khuNhaActions';

class DanhSachKhuNha extends Component {
    constructor(props) {
        super(props);
        this.state = {
            KhuNhas: []
        }
    }

    componentDidMount = () => this.props.hienThiCacKhuNha();

    render() {
        var ar = this.props.khuNhaReducer.KhuNhas;
        return (
          ar.map(khunha => {
              <KhuNha tenKhuNha={khunha.tenKhuNha} />
          })
        );
    }
}

const mapStatetoProps = state => ({
    khuNhaReducer: state.khuNhaReducer
})
export default connect(mapStatetoProps, {hienThiCacKhuNha} )(DanhSachKhuNha)
